import styled from 'styled-components'

export const Card = styled.div`
    position: relative;
    min-height: 1px;
    width: 100%;
    height: 100%;
    float: left;
`
export const Img = styled.div`
    background: ${props => `url(${props.img}) no-repeat top center`};
    width: 100vw;
`
